import React from "react";
import {
  LayoutDashboard,
  MessageSquare,
  CalendarDays,
  FileUp,
  Workflow,
  ClipboardList,
  LogOut,
  UsersRound,
  Zap,
} from "lucide-react";
import { useNavigate, useLocation } from "react-router-dom";

const Sidebar: React.FC = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const navItems = [
    { label: "Dashboard", icon: LayoutDashboard, path: "/dashboard", badge: null },
    { label: "Chat", icon: MessageSquare, path: "/chat", badge: 3 },
    { label: "Tasks", icon: ClipboardList, path: "/tasks", badge: 5 },
    { label: "Meetings", icon: UsersRound, path: "/meetings", badge: null },
    { label: "Calendar", icon: CalendarDays, path: "/calendar", badge: null },
    { label: "Files", icon: FileUp, path: "/files", badge: null },
    { label: "Workflows", icon: Workflow, path: "/workflows", badge: null },
  ];

  return (
    <aside className="h-screen w-64 flex flex-col bg-white border-r border-slate-200">
      {/* Compact Logo Header */}
      <div
        className="flex items-center gap-3 px-4 py-5 border-b border-slate-200 cursor-pointer group"
        onClick={() => navigate("/dashboard")}
      >
        <div className="relative">
          <div className="w-10 h-10 rounded-lg bg-gradient-to-br from-blue-500 to-purple-600 flex items-center justify-center shadow-md group-hover:shadow-lg transition-shadow duration-300">
            <Zap size={20} className="text-white" strokeWidth={2.5} />
          </div>
        </div>
        <div className="flex-1">
          <h1 className="text-lg font-black text-slate-800">Collabryta</h1>
          <p className="text-xs text-slate-500">Team Workspace</p>
        </div>
      </div>

      {/* Navigation */}
      <nav className="flex-1 overflow-y-auto p-3 space-y-1">
        {navItems.map(({ label, icon: Icon, path, badge }) => {
          const active = location.pathname === path;
          return (
            <button
              key={path}
              onClick={() => navigate(path)}
              className={`
                relative w-full flex items-center gap-3 px-3 py-3 rounded-lg
                font-medium text-sm transition-all duration-200 group/item
                ${active
                  ? "bg-slate-900 text-white shadow-sm"
                  : "text-slate-700 hover:bg-slate-100"
                }
              `}
            >
              {/* Active Indicator Dot */}
              {active && (
                <div className="absolute left-0 top-1/2 -translate-y-1/2 -translate-x-1.5 w-1.5 h-8 bg-blue-500 rounded-r-full" />
              )}

              {/* Icon */}
              <Icon
                size={20}
                strokeWidth={active ? 2.5 : 2}
                className="flex-shrink-0"
              />

              {/* Label */}
              <span className="flex-1 text-left">{label}</span>

              {/* Badge */}
              {badge && badge > 0 && (
                <span className={`
                  px-1.5 py-0.5 text-xs font-bold rounded-md min-w-[18px] text-center
                  ${active
                    ? "bg-blue-500 text-white"
                    : "bg-red-500 text-white"
                  }
                `}>
                  {badge}
                </span>
              )}
            </button>
          );
        })}
      </nav>

      {/* Divider */}
      <div className="h-px bg-slate-200 mx-3" />

      {/* User Section */}
      <div className="p-3">
        <div className="flex items-center gap-3 p-2 rounded-lg hover:bg-slate-50 transition-colors duration-200 cursor-pointer">
          <div className="relative flex-shrink-0">
            <div className="w-9 h-9 rounded-lg bg-gradient-to-br from-blue-500 to-purple-600 flex items-center justify-center text-white font-bold text-sm shadow-sm">
              A
            </div>
            <span className="absolute -bottom-0.5 -right-0.5 w-3 h-3 bg-green-500 border-2 border-white rounded-full"></span>
          </div>
          <div className="flex-1 min-w-0">
            <p className="text-sm font-semibold text-slate-800 truncate">Ashok Kumar</p>
            <p className="text-xs text-slate-500">Admin</p>
          </div>
        </div>

        {/* Logout Button */}
        <button
          onClick={() => navigate("/login")}
          className="
            w-full mt-2 flex items-center justify-center gap-2 px-3 py-2.5 rounded-lg
            font-medium text-sm transition-all duration-200
            bg-slate-100 text-slate-700 hover:bg-red-50 hover:text-red-600
            border border-transparent hover:border-red-200
            group
          "
        >
          <LogOut size={16} className="transition-transform duration-200 group-hover:-translate-x-0.5" />
          <span>Sign Out</span>
        </button>
      </div>
    </aside>
  );
};

export default Sidebar;
